// React imports
import React from "react";
import { Routes, Route } from "react-router-dom";
import Navigation from "./Components/Navigation";
import FooterNav from "./Components/FooterNav";
import HomePage from "./Pages/HomePage";
import Registration from "./Pages/Registration";
import InputLabel from "./Components/RegisterPageComponents/InputLabel";
import Surname from "./Components/RegisterPageComponents/Surname";

// Custom imports

function App() {
  return (
    <div>
      <Navigation />

      {/* route for the links to different pages */}
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="///Name" element={<InputLabel />} />
        <Route path="/Surname" element={<Surname />} />
      </Routes>

      <FooterNav />
    </div>
  );
}

export default App;
